import * as React from 'react';
import { Container, HStack, Icon, IconButton, Text } from 'native-base';
import { Dimensions } from 'react-native';

interface IProps {

}

const Home: React.FC<IProps> = () => {
    const { width } = Dimensions.get('window');

    return <Container bg={'blue.50'} w={'100%'}>
        <HStack bg="#6200ee" px="1" py="3" justifyContent="space-between" alignItems="center" w={width}>
            <HStack alignItems="center">
                <IconButton icon={<Icon size="sm" name="menu" color="white" />} />
                <Text color="white" fontSize="20" fontWeight="bold">
                    Home
                </Text>
            </HStack>
            <HStack>
                <IconButton icon={<Icon name="favorite" size="sm" color="white" />} />
                <IconButton icon={<Icon name="search" size="sm" color="white" />} />
                <IconButton icon={<Icon name="more-vert" size="sm" color="white" />} />
            </HStack>
        </HStack>
        <Text>Home</Text>
    </Container>
}

export default Home;
